package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_WIFI_CONFIG_AP_RESPONSE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e WIFI_CONFIG_AP_RESPONSE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := WIFI_CONFIG_AP_RESPONSE_UNDEFINED.MarshalText()
		require.NoError(t, err)

		var dec WIFI_CONFIG_AP_RESPONSE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, WIFI_CONFIG_AP_RESPONSE_UNDEFINED, dec)
	})
}
